pragma solidity ^0.8.12;

import "hardhat/console.sol";

contract BCTypes {

    // From BCGames.sol
    enum DoorStatus { NO_DOOR, CLOSED, OPEN, BREACHED, WINDOW }
    enum Action { HACK, BREACH, MOVE, PASS } // TODO: Add rest
    enum Followthrough { NONE, MOVE }

    struct Player {
        address owner;
        address charContractAddress;
        uint256 characterId;

        Position position;
        // 20,000 to write a word vs. 3 to add numbers, will not store updated characteristics
        uint8 healthDmgTaken;
        uint8 armorDmgTaken;
        uint8 actionsTaken;

        uint8 dataTokens;
        uint8[] currentEffects; // Mark true if effect is present
        uint8[] inventoryIDs; // TODO: figure out how to manage inventory

        // Flags
        bool canHarmOthers;
        bool dead;
    }

    struct WorldItem {
        address itemContract;
        uint id;

        Position position;
        bool destroyed; // TODO: Discarded vs. destroyed (probably remove destroyed)
    }

    struct EventTracker {
        uint8 bugEvents;
        uint8 mysteryEvents;
        uint8 scavEvents;
        uint8 shipEvents;
    }

    struct Position {
        uint8 row;
        uint8 col;
    }

    struct GameTile {
        // Position pos;
        // uint8 timesUsed;  // Used to turn off egg room, etc.
        uint8 roomId;
        uint8 parentId;

        uint[4] doors; // n, s, e, w

        bool explored;
        bool looted;
        bool hasVent;
    }

        struct Door {
        uint8 vsBreach;
        uint8 vsHack;
        DoorStatus status;
    }

    struct Map {
        mapping (uint => RoomTile) roomList;
        uint8 numRooms;

        mapping (uint => bool) usedRooms;

        // Row, Col => GameTile
        mapping (uint => mapping (uint => GameTile)) board;
        mapping (uint => Door) doors;
        uint8 numDoors; // Ordering

        Position startPosition;
    }

    struct Game {
        // TODO: Should games just always be 3 or 4 players???
        bool active;

        uint[] playerIndexes;
        uint currentPlayerTurnIndex; // TODO: Default of player zero
        uint numPlayers;
        // uint256[] itemIDs; // Items in (owned by) the game

        uint turnsTaken; // TODO: Can this be smaller?

        EventTracker eventTracker;

        address mapContract; // TODO: Handle if game contract changes!!!!
        uint mapId;

        // uint8 currentPlayerTurn;
        // uint8 startPlayerIndex;
    }

    struct Lobby {
        bool gameStarted;
        uint8 numberOfPlayers;
        uint[] playerIndexes;

        // uint expireTime; TODO: Lobbys should possibly expire, or maybe set a timer to allow starting with three
    }

    // From RoomTiles.sol
        enum BCEventType {NONE, BUG, MYSTERY, SCAVENGER, SHIP_SECURITY}

    struct RoomTile {
        string name; // One time cost and convenient // TODO: Except it gets copied every time.  Delete later
        // string artLink; // Don't need to know art, names, or desc in-contract
        BCEventType eventType;
        uint256 eventNum; // 0 if no event in room

        // uint8 numDoors; // TODO: Decide whether or not to implement
        // uint8 totalDoorStrength;
        // uint8 numWindows;

